eval("module.exports = JSON.parse('[{\"name\":\"河 明宗\",\"CO\":\"VeryLongAnimals<br/>Founder\",\"site\":\"https://verylonganimals.notion.site/VeryLongAnimals-866baf6526a4404ab674acc41715cd21\",\"twitter\":\"https://mobile.twitter.com/gdvonly\",\"profile\":\"顔が長い動物のNFTコレクション/VeryLongAnimals/のファウンダー・創業時クリエイター。VeryLongAnimalsは開始2ヶ月半時点で100以上の二次創作シリーズを持ち、Twitterでの登場頻度は日本で最大級。VeryLongAnimals GENESISは2ETH近い単価での取引が行われている。\"},{\"name\":\"Roi Senshi\",\"CO\":\"DeFi探検隊隊長\",\"site\":\"https://discord.gg/8ebubP4GKn\",\"twitter\":\"https://twitter.com/RoiSarak\",\"profile\":\"仮想通貨 #Avalanche のスペシャリスト。#Chainlink 公式Advocate🇸🇬, DeFi探検隊隊長\"},{\"name\":\"Yoshitaka Okayama\",\"CO\":\"Polyogn/Fracton Ventures\",\"site\":\"https://polygon.technology \",\"twitter\":\"https://fracton.ventures/\",\"profile\":\"PolygonJapanコミュニティマネージャー。複数プロジェクトに従事しており、Polygon,Fracton,個人でそれぞれweb3プロジェクトを行う。\"},{\"name\":\"ビニール\",\"CO\":\"Fracton Ventures\",\"site\":\"https://fracton.ventures/\",\"twitter\":\"https://twitter.com/vvinyll\",\"profile\":\"2017年より暗号資産への投資を開始。海外プロジェクトの日本アンバサダーなどを務め、日本コミュニティの拡大や運営などを経験。現在はWeb3及びNEARブロックチェーンの教育や啓蒙を担当。\"},{\"name\":\"Yosui Harasawa\",\"CO\":\"モノバンドル株式会社\",\"site\":\"https://monobundle.com/n\",\"twitter\":\"https://twitter.com/y0su1\",\"profile\":\"大学在学中から3年間、ブロックチェーンリサーチャーとして活動。その後、日本初の日本円連動ステーブルコイン「JPYC」を取り扱う JPYC 株式会社に立ち上げ期から参画し、COO として事業成長を牽引。<br/>2021年6月にモノバンドル株式会社を設立。「NFTのインフラ」としてグローバルにNFTの開発ツールを提供するEmbedded NFTサービス「Hokusai」とデジタル資産の監査・認証プロバイダー事業「SuperAudit」をリリースし、Web3のインフラ事業を展開している。\"},{\"name\":\"木村 優\",\"CO\":\"UnUniFi protocol founder<br/> CauchyE, Inc. CEO, CTO\",\"site\":\"https://ununifi.io\",\"twitter\":\"https://twitter.com/KimuraYu45z\",\"profile\":\"UnUniFi protocol founder. CauchyE, Inc. CEO, CTO.<br/>京都大学経済学部卒・経営管理大学院修了・情報学研究科博士課程在籍。<br/> 個人投資家のハッキングされた5億円相当のATOM等を救出したことのある一応ホワイトハッカー\"},{\"name\":\"Noriaki Nakata\",\"CO\":\"SBINFT\",\"site\":\"https://sbinft.market/\",\"twitter\":\"https://twitter.com/vvinyll\",\"profile\":\"CMO of SBINFT<br/> From event execution to research, a lot of roles have been accomplished in the NFT community. Starting off as a researcher & translator in NFTs, later moves on as a Event Organizer to push the boundaries in the Japanese community. After joining the nanakusa team, working together with 190 artists and partners have been a big part of the activities ,utilizing the great technology and art to find the solution for what the Japanese community have been struggling. Crypto Art which consists of Art, Vision, and Blockchain Technology, is the passion and interest to the future.<br/>Organizer of CAWA in TOKYO & CRYPTO ART FES 2022<br/>Translator (ENG⇔JPN), NFT Analyst<br/>Planner & Translator of TEAM NAGOMI <br/>Member of 8DAO\"},{\"name\":\"窪田　昌弘\",\"CO\":\"LOCK ON/CEO\",\"site\":\"https://lockon.finance/\",\"twitter\":\"https://twitter.com/lan_masa_kubota\",\"profile\":\"LOCK ON Founder<br/>コピートレードサービス、マーケット推移通知サービス、NFTゲームなど複数のサービスをリリース。<br/>資金調達、2度の事業売却を経験。\"},{\"name\":\"Leona Hioki\",\"CO\":\"Ryodan Systems\",\"site\":\"https://zkcloud.systems\",\"twitter\":\"https://twitter.com/HiokiLeona\",\"profile\":\"zkRollup研究者。2021年にzkRollupの改良案をEthereumコミュニティに複数提案し、これらは数多く議論された。以前はRollupの前身であったPlasmaのリサーチの他、黎明期にあったNFTやDeFiにおける開発を行うSolidityプログラマーであった。\"},{\"name\":\"Sota Watanabe\",\"CO\":\"Astar Network Founder\",\"site\":\"https://astar.network/\",\"twitter\":\"https://twitter.com/WatanabeSota\",\"profile\":\"Co-founder and CEO at Phi. Our mission is to visualize on-chain identity and create an open and inclusive metaverse land system that is based on universal web3 building blocks, such as ENS domains and wallet activity.\"},{\"name\":\"Shugo Tsuji\",\"CO\":\"Phi/ Co-founder and CEO\",\"site\":\"https://twitter.com/phi_xyz\",\"twitter\":\"https://twitter.com/shugo_jpn\",\"profile\":\"Co-founder and CEO at Phi. Our mission is to visualize on-chain identity and create an open and inclusive metaverse land system that is based on universal web3 building blocks, such as ENS domains and wallet activity.\"},{\"name\":\"Shun Kakinoki\",\"CO\":\"Light Founder\",\"site\":\"https://light.so\",\"twitter\":\"https://twitter.com/shunkakinoki\",\"profile\":\"I am a builder, hacker, & pioneer striving to obliterate the galaxy. I have spent my childhood years in Silicon Valley (Cupertino City) from 4 to 10 years old and have 3+ years of experience in AI/CV/DL, web development & and cloud infrastructure (especially DevOps). Love open source and excited about the potential of startups & Web 3.0 towards the future of the world.\"},{\"name\":\"Kazuki Abe\",\"CO\":\"EERUCA LAB PTE. LTD.<br/>Wall of Death Inc.\",\"site\":\"https://wall-of-death.com/\",\"twitter\":\"https://twitter.com/aalazy_\",\"profile\":\"ERUCA LAB PTE LTD. Co-Founder, COO / 早稲田大学政治経済学部経済学科4年 / PENTAというListen to Earnプロダクトを運営する、ERUCA LAB PTE. LTD.のCo-Founder, COOで、プロダクトの戦略設計や、開発以外の全てを担当。過去の職歴としては、モノバンドル株式会社の人事担当や、株式会社Donutsでのライブ配信アプリのPM, モンスターエナジージャパン合同会社にてフィールドマーケオペレーションなどの長期インターンを大一年時から経験。昨年12月から現ERUCA LABの前身となる株式会社ウォールオブデスにてCOOとして従事。\"},{\"name\":\"田中 章雄\",\"CO\":\"Headline </br> IVC 創業パートナー\",\"site\":\"https://www.ivcrypto.io\",\"twitter\":\"https://twitter.com/tanakaakio\",\"profile\":\"Moved to the U.S. at age 16Headline Asiaの創業パートナー。Headlineは北米、南米、欧州、アジア各地でインターネットベンチャーに投資するグローバルVC。また2021年にAnimoca, Circle, Digital Currency Groupなどの海外投資家が中心に出資する約110億円のトークン専用ファンドIVCを立ち上げ、現在アジアで最もGameFiやWeb3のシードステージに出資するVCとして150以上のクリプトポートフォリオを持つ。Headline及びIVCのポートフォリオにはSoRare, C2X, Crypto Unicorns, Irreverent Labs, MetaTheory, Proof of Learn,YGG, YGG SEA,  YGG Japan, JPYC, Yay! (Nanameue), Double Jump, Oasys などが並ぶ。\"},{\"name\":\"志村 侑紀\",\"CO\":\"shiftbase, Inc.<br/> UNCHAIN, Founder\",\"site\":\"https://app.shiftbase.xyz/\",\"twitter\":\"https://twitter.com/yuki_unchain\",\"profile\":\"16歳で渡米。University of California Los Angels（UCLA）卒業後、2年間Harvard UniversityにてMina Cikara教授のもと社会心理学と神経科学の学際的研究に従事。孫正義育英財団の一期生として渡英し、University College London（UCL）に所属。2020年10月よりResearch Directorとして株式会社Empathに参画。2022年2月より、web3領域における事業開発を主軸とした株式会社shiftbaseを創業。\"},{\"name\":\"TOM\",\"CO\":\"BOSO TOKYO -暴走東京-<br/>Operation Lead\",\"site\":\"https://www.bosotokyo.com/\",\"twitter\":\"https://twitter.com/BosoTokyo\",\"profile\":\"複数のゲーム会社でゲームのプロデューサーを経験。オンライン麻雀ゲームをプロデュースし日本最大の同時接続者数を達成。その後カプコンに移り、オリジナルIPのブラウザタイトルや、ストリートファイターやモンスターハンターなどのIPを利用したモバイルアプリゲームのプロデュースや運営に携わってきた。メタバースや、NFTの盛り上がりに興味を持っていたこと、元々ゲームを通じて世界における日本発IPの強さを体感していたことから、NFT×メタバース×日本発という組み合わせのプロジェクトの設立に加わる。\"},{\"name\":\"Adam Gomez\",\"CO\":\"Portals CEO\",\"site\":\"https://theportal.to/\",\"twitter\":\"https://twitter.com/adamq_q\",\"profile\":\"Adam Gomez is cofounder and CEO of Portals. Portals development began in early 2021, with the concept of \\'Animal Crossing meets the Metaverse\\'. Before starting Portals, the Portals team had built multiple successful software businesses in the games industry, working with clients like Activision Blizzard, Riot Games, Sega, Marvel, Disney, Facebook and Microsoft.\"},{\"name\":\"Ben Pember\",\"CO\":\"DEFY Labs  Co-founder\",\"site\":\"https://defydisrupt.io/\",\"twitter\":\"https://twitter.com/defydisrupt\",\"profile\":\"BEN PEMBER - Co-Founder Ben is an experienced entrepreneur with backgrounds in the sport and technology industries. After leaving IMG, Ben initially founded Exceed Sports & Entertainment in 2013, building an award winning regional business focussed on developing health & lifestyle event IP. In 8 years Exceed has hosted 32 events in 10 countries with over 500,000 attendees. Making a move into the world of technology, Ben co-founded District Technologies in 2017, building a team that has built and scaled highly successful B2C & B2B location based, gamified fitness mobile apps. Ben brings a strong commercial focus to the business having secured multi million dollar partnerships with global brands such as adidas, Redbull and MasterCard.\"},{\"name\":\"たぬきち\",\"CO\":\"SoooN/CMO\",\"site\":\"https://twitter.com/web3_honey\",\"twitter\":\"https://twitter.com/web3_honey\",\"profile\":\"国内外の多数のクリプトイベントに参加＆運営。コミュニティから事業まで幅広く活動し、Web3業界の拡大に尽力する。</br>IVS公式アンバサダー＆司会。</br>Arriba社公式アンバサダー。\"},{\"name\":\"西村太郎\",\"CO\":\"合同会社ENJOY\",\"site\":\"http://enjoy-llc.co.jp/\",\"twitter\":\"https://yfl.jp/\",\"profile\":\"IT事業を中心に経営者歴約17年。7年ほど前にIPOを目指し数億円の資金調達を行ったが挫折。1年半ほど前にDeFiに魅了され、BlockChainのSystem開発会社とDiscordコミニティー（YFL）を単独で設立。現在12名程のteamsでワイワイガヤガヤ事業拡大中。9月より東新宿にてCryptoCafe&BARをOPEN予定。\"},{\"name\":\"Masa Kakiya\",\"CO\":\"Director, ConsenSys\",\"site\":\"https://consensys.net/\",\"twitter\":\"https://twitter.com/ConsenSys/\",\"profile\":\"Masa Kakiya was most recently the Sales Director for Oracle Financial Services Global</br>Business Unit and currently the Strategic Sales Director for ConsenSys Japan in charge of all local initiatives. He has held a number of roles in the finance sector, starting his career at ING Bank, he also served as a FX broker for ICAP, a sales manager for a hedge fund, a BD</br>manager at Murex, and spearheaded the Japanese operation for ICE (Intercontinental </br> Exchange-SuperD). Masa is a graduate of Keio University, Faculty of Economics.\"},{\"name\":\"設楽悠介\",\"CO\":\"株式会社幻冬舎</br>あたらしい経済</br>編集長\",\"site\":\"https://www.neweconomy.jp/\",\"twitter\":\"https://twitter.com/ysksdr\",\"profile\":\"幻冬舎でブロックチェーン/暗号資産専門メディア「あたらしい経済」を創刊。同社コンテンツビジネス局で編集や新規事業を担当。幻冬舎コミックスの取締役を兼務。「Fukuoka Blockchain Alliance」のボードメンバーも務める。「みんなのメンタールーム（Amazon audible）」「風呂敷畳み人ラジオ（Voicy）」「Podcast総研」等のポッドキャスト配信。著書『畳み人という選択』（プレジデント社）。 \"},{\"name\":\"Ryan Li\",\"CO\":\"CyberConnect</br>Co-Founder  \",\"site\":\"https://link3.to/\",\"twitter\":\"https://twitter.com/cyberconnect;\",\"profile\":\"Ryan is the co-founder of CyberConnect, who previously co-founded Lino Blockchain & DLive (acquired by BitTorrent). A graduate of UC Berkeley, Ryan also has previous work experiences at Google and Instagram. \"},{\"name\":\"竹内春華\",\"CO\":\"Nishikigoi NFT</br>山古志住民会議代表 \",\"site\":\"https://nishikigoi.on.fleek.co\",\"twitter\":\"https://twitter.com/nishikigoiNFT\",\"profile\":\"新潟県魚沼市出身。</br>2007年　生活支援相談員として、山古志災害ボランティアセンターに所属。</br>中越地震で被災した旧山古志村の住民が暮らす仮設住宅にて活動する。</br>2008年　地域復興支援員として、住民主体の地域づくり団体「山古志住民会議」の事務局をつとめながら地域住民と各種事業をおこなう。</br>2021年4月より山古志住民会議の代表を務める。\"}]');\n\n//# sourceURL=webpack://web32/./i81/profile_jp.json?");

